    int max_water = F / (A + E);
    int max_sugar = F - max_water * A;

    int max_density = 0;
    int max_mass = 0;
    int max_sugar_mass = 0;

    for (int i = 0; i <= max_water; i++) {
        for (int j = 0; j <= max_sugar; j++) {
            if (i * A + j > F) {
                break;
            }
            if (i * B + j > F) {
                break;
            }
            if (i * A + j <= F && i * B + j <= F) {
                int sugar = (i * A + j) * E / (A + E);
                if (sugar + j <= max_sugar && i * B + (sugar + j) <= F) {
                    int density = (100 * sugar) / (i * A + (sugar + j));
                    if (density > max_density) {
                        max_density = density;
                        max_mass = i * A + (sugar + j);
                        max_sugar_mass = sugar;
                    }
                }
            }
        }
    }

    printf("%d %d\n", max_mass, max_sugar_mass);

    return 0;
}
